  return (
    <View style={styles.container}>
      <View>
        <View style={styles.logos}>
        <Image source={require('./assets/images/logo-login.png')} style={styles.logoRocket} />
        </View>
        <View style={styles.logBlock}>
          <TextInput placeholder='Digite seu nome' style={{borderColor:'#fff', borderWidth:1, borderRadius:6, width:250, height:40, textAlign:'center', color:'#fff'}}/>
          <TextInput placeholder='Digite seu nome' style={{borderColor:'#fff', borderWidth:1, borderRadius:6, width:250, height:40, textAlign:'center', color:'#fff'}}/>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#333733',
